// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;


contract Data {
    uint n;

    function f() public {
        n = n*n;
    }

    function getN() public view returns (uint){
        return n;
    }
}

contract Upgrade {

    function f1(address _contract,string memory _method) public {
        (bool success,bytes memory data) = _contract.delegatecall(abi.encodeWithSignature(_method));
        // _ = _contract.delegatecall(abi.encodeWithSignature(_method));
    }

}

